import { Header } from "../../components/Header/Header";
import "./TopicsPage.scss";
import { useSelector } from "react-redux";
import { TopicsContent } from "../../components/TopicsContent/TopicsContent";
import { LoaderResults } from "../../components/LoaderResults/LoaderResults";

export const TopicsPage = () => {
  const stepFive = 5;
  const stateConfirmBtn = useSelector((state) => state.confirmLustQuiz);
  return (
    <div className="topicsPageContainer">
      {!stateConfirmBtn ? (
        <>
          <Header step={stepFive} />
          <TopicsContent />
        </>
      ) : (
        <LoaderResults />
      )}
    </div>
  );
};
